INSERT INTO "my_adventures"("title", "is_deleted", "image_url", "item_type", "link", "source", "journey_destiny", "script_content", "play_list", "douban_id", "douban_rank", "address", "shop_name", "province", "city", "district") VALUES ('', 0, '', 1, '', 0, '', '一个小男孩拿着一张假钱走进了玩具店，准备买一架玩具飞机。 服务员阿姨说：“小朋友，你的钱不是真的。 ”小男孩反问道：“阿姨，难道你的飞机是真的？”', '', 0, 0, '', '', '', '', '');
INSERT INTO "my_adventures"("title", "is_deleted", "image_url", "item_type", "link", "source", "journey_destiny", "script_content", "play_list", "douban_id", "douban_rank", "address", "shop_name", "province", "city", "district") VALUES ('', 0, '', 1, '', 0, '', '昨天被一个陌生女人搭讪了。\n我坐着在玩手机，一个女人走了过来，拍了拍我。\n我抬头一看，是一个年纪略大长得不错的女人。\n我对她说：“对不起，我有女朋友了。”\n她怒道：“你再玩手机，我就收你卷子了。”\n我无奈闭上嘴。', '', 0, 0, '', '', '', '', '');
INSERT INTO "my_adventures"("title", "is_deleted", "image_url", "item_type", "link", "source", "journey_destiny", "script_content", "play_list", "douban_id", "douban_rank", "address", "shop_name", "province", "city", "district") VALUES ('', 0, '', 1, '', 0, '', '和老公一起去吃烧烤，他想要吃俩腰子，让我去跟服务员说，转头就看见老公跟旁桌的一位女性要微信号，我一下就🔥了，抄起烧烤师傅边上的🌶粉，走过去直接就扣在了他脸上，我给你脸了是不是，他么的。', '', 0, 0, '', '', '', '', '');
INSERT INTO "my_adventures"("title", "is_deleted", "image_url", "item_type", "link", "source", "journey_destiny", "script_content", "play_list", "douban_id", "douban_rank", "address", "shop_name", "province", "city", "district") VALUES ('', 0, '', 1, '', 0, '', '上次把🌶粉扣在老公头上后，这几天我们处于冷战中，他给我做了我最爱吃的蛋挞，希望我能消消气原谅他。我很生气，但那个蛋挞又很吊我的胃口，于是我几经思虑之后，冲下楼去蛋糕店买了几个蛋挞，吃完回家，666。', '', 0, 0, '', '', '', '', '');
